import React from "react";

const year = new Date().getFullYear();

function Footer() {
  return (
    <footer>
      <div id="footer" className="footer">
        <p>
          Copyright &copy; {year}
          Kenns Carlo Estavillo.
        </p>
      </div>
    </footer>
  );
}
export default Footer;
